  gap:40px;display: inline-flex;
  flex-wrap: wrap;
  justify-content: center;

`;


const ArticleList = ({unfeatured}) => {
    return(
        <>
        <CardSection>
         {unfeatured.map((article) => (

        <Card key={article.date} article={article} />

      ))}
      </CardSection>


        </>
    );
}

export default ArticleList;
